from sympy import *
x, t = symbols('x t')
u, u0, u1, phi = symbols('u u0 u1 phi', cls = Function)
nu = symbols('nu')
e1, e2, e3, d = symbols('e1 e2 e3 d')
u = u0(x,t)/phi(x,t) + u1(x,t)
####################################################################################
## Fisher KPP equation (with unity diffusion coefficient) ##########################
####################################################################################
print('##################################################################')
print('Painleve analysis for the Fisher KPP equation (from Conte\'s book)')
print('##################################################################')
u = u0(x,t)/phi(x,t) + u1(x,t)
gens = [phi(x,t), 1/phi(x,t), diff(phi(x,t) ,t), diff(phi(x,t), x), diff(phi(x,t),x,x)]
print('>> Painleve expansion taken as u = ')
pprint(u)
FisherKPP = poly((diff(u,t)-diff(u,x,x)+2/d**2*(u-e1)*(u-e2)*(u-e3)),gens=gens).as_expr()
# print(FisherKPP.coeff(1/phi(x,t), 3))
eqnsoln = solve(FisherKPP.coeff(1/phi(x,t), 3), u0(x, t))
# print(eqnsoln)
print('>> u0(x, t) = ') 
pprint(eqnsoln[2])
u = eqnsoln[2]/phi(x,t) + u1(x,t)
print('>> Substituting u0 in the original Painleve expansion we get u =')
print(u)
gens.append(Derivative(phi(x, t), (x, 3)))
gens.append(Derivative(phi(x, t), t, x))
# gens.append(Derivative(phi(x, t), t, x))
FisherKPP2 = poly((diff(u,t)-diff(u,x,x)+2/d**2*(u-e1)*(u-e2)*(u-e3)),gens=gens).as_expr()
# print(FisherKPP2.coeff(1/phi(x,t), 3))
# print(FisherKPP2.coeff(1/phi(x,t), 2))
eqnsoln2 = solve(FisherKPP2.coeff(1/phi(x,t), 2), u1(x, t))
print('>> u1(x, t) = ') 
print(eqnsoln2[0])
# print(eqnsoln2[0])
# print(len(eqnsoln2))
u = eqnsoln[2]/phi(x,t) + eqnsoln2[0]
print('>> Substituting u0 and u1 in the original Painleve expansion we get u =')
print(u)
gens.append(Derivative(phi(x, t), t, (x, 2)))
gens.append(Derivative(phi(x, t), (x, 4)))
gens.append(1/Derivative(phi(x, t), x))
gens.append(Derivative(phi(x, t), (t, 2)))
FisherKPP3 = poly((diff(u,t)-diff(u,x,x)+2/d**2*(u-e1)*(u-e2)*(u-e3)),gens=gens).as_expr()
# print(FisherKPP3.coeff(1/phi(x,t), 3))
# print(simplify(FisherKPP3.coeff(1/phi(x,t), 2)))
print('>> The other associated equations are given as follows:')
print('>> ')
print(FisherKPP.coeff(1/phi(x,t), 1), ' = 0')
print('>> ')
print(FisherKPP2.coeff(phi(x,t), 0), ' = 0')
